        "body": "From: https://issues.numenta.org/browse/NPC-351\r\n\r\nThe cluster (\"grok_1\") was experiencing hbase issues at the time, and all of the job's (jobid=6933) models were either orphaned of failed. Despite the fact that there was not a single successfully-completed model, the swarm job recorded that the swarm completed successfully and terminated (it should have recorded failure instead):\r\n\r\nhttp://pastebin.com/xhbYGDr3\r\n\r\nHere are the 120 models from the models table associated with this job:\r\n\r\nhttps://drive.google.com/file/d/0B99vQZHZRc_gb0tHVEFPYXFONVU/edit?usp=sharing"
